@jonathanmosenkis  From what I understand, I'm comparing the file with the wiki version here
https://he.wikisource.org/wiki/%D7%9E%D7%A9%D7%A0%D7%94_%D7%9B%D7%9C%D7%90%D7%99%D7%9D

This particular instance strangely enough is a case of 2 mishnayot being combined in the actual text - the mishna is jointly numbered ד-ה. Wiki has it separate but mishna ד is just blank.

@shoshanakahan Okay, then let me try to be more articulate. The files you are looking at is a comparison between two versions of the Mishnah currently existing on Sefaria draft. The wiki version is what is displayed on Sefaria production, which is being replaced with the Vilna edition.

The links go to the wiki version by default, as that is the primary edition currently on Sefaria right now. If something needs to be changed, it's probably best to have both versions open side by side.

Also, keep your eyes open, because one of the core engineers is going to run code that will change the English translations of the Mishnah, so any work that is done there will be lost.
